description:
Cherry and her boyfriend put their hand on a copy of the famous Kama Sutra. They think it would be a great time to learn more about sex. While they turn the pages, they get into the mood... so they put the book aside (along with their clothes) and start to make love. We wouldn't claim that they get to the expert level, but they definitely have a great time together.

